(300, '_site_transient_tenweb_auth_error_logs', 'a:1:{s:25:\"send_site_state_api_error\";a:2:{s:3:\"msg\";s:8915:\"[{\"message\":\"404 Not Found\",\"status_code\":404},\"https:\\/\\/manager.10web.io\\/api\\/site-state\\/\",{\"method\":\"POST\",\"body\":{\"data\":{\"blog_id\":null,\"plugins_info\":{\"is_network\":0,\"products\":[{\"product_id\":101,\"slug\":\"photo-gallery\",\"title\":\"Photo Gallery\",\"description\":\"This plugin is a fully responsive gallery plugin with advanced functionality.  It allows having different image galleries for your posts and pages. You can create unlimited number of galleries, combine them into albums, and provide descriptions and tags.\",\"version\":\"1.8.9\",\"installed\":1,\"active\":1,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"\",\"tenweb_product\":1,\"author\":\"Photo Gallery Team\",\"repo_version\":\"1.8.9\"},{\"product_id\":177,\"slug\":\"tenweb-speed-optimizer\",\"title\":\"10Web Booster\",\"description\":\"Optimize your website speed and performance with 10Web Booster by compressing CSS and JavaScript.\",\"version\":\"2.11.43\",\"installed\":1,\"active\":1,\"network_active\":0,\"is_paid\":1,\"screenshot\":\"\",\"tenweb_product\":1,\"author\":\"10Web - Website speed optimization team\",\"repo_version\":\"2.11.43\"},{\"product_id\":51,\"slug\":\"10web-manager\",\"title\":\"10WEB Manager\",\"description\":\"\",\"version\":\"0.0.0\",\"installed\":1,\"active\":1,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"\",\"tenweb_product\":1,\"author\":\"\",\"repo_version\":null},{\"product_id\":0,\"slug\":\"akismet\",\"title\":\"Akismet Anti-Spam\",\"description\":\"Used by millions, Akismet is quite possibly the best way in the world to <strong>protect your blog from spam<\\/strong>. It keeps your site protected even while you sleep. To get started: activate the Akismet plugin and then go to your Akismet Settings page to set up your API key.\",\"version\":\"5.0.1\",\"installed\":1,\"active\":0,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"\",\"tenweb_product\":0,\"author\":\"Automattic\",\"repo_version\":\"5.0.2\"},{\"product_id\":0,\"slug\":\"classic-editor\",\"title\":\"Classic Editor\",\"description\":\"Enables the WordPress classic editor and the old-style Edit Post screen with TinyMCE, Meta Boxes, etc. Supports the older plugins that extend this screen.\",\"version\":\"1.6.2\",\"installed\":1,\"active\":0,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"\",\"tenweb_product\":0,\"author\":\"WordPress Contributors\",\"repo_version\":\"1.6.2\"},{\"product_id\":0,\"slug\":\"hello.php\",\"title\":\"Hello Dolly\",\"description\":\"This is not just a plugin, it symbolizes the hope and enthusiasm of an entire generation summed up in two words sung most famously by Louis Armstrong: Hello, Dolly. When activated you will randomly see a lyric from <cite>Hello, Dolly<\\/cite> in the upper right of your admin screen on every page.\",\"version\":\"1.7.2\",\"installed\":1,\"active\":0,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"\",\"tenweb_product\":0,\"author\":\"Matt Mullenweg\",\"repo_version\":\"1.7.2\"},{\"product_id\":0,\"slug\":\"modula-best-grid-gallery\",\"title\":\"Modula\",\"description\":\"Modula is the most powerful, user-friendly WordPress gallery plugin. Add galleries, masonry grids and more in a few clicks.\",\"version\":\"2.7.1\",\"installed\":1,\"active\":0,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"\",\"tenweb_product\":0,\"author\":\"WPChill\",\"repo_version\":\"2.7.1\"}]},\"themes_info\":{\"is_network\":0,\"products\":[{\"product_id\":0,\"slug\":\"blockbase\",\"title\":\"Blockbase\",\"description\":\"Blockbase is a simple theme that supports full-site editing. It comes with a set of minimal templates and design settings that can be manipulated through Global Styles. Use it to build something beautiful.\",\"version\":\"3.1.4\",\"installed\":1,\"active\":0,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"http:\\/\\/localhost\\/balaykobo2\\/wp-content\\/themes\\/blockbase\\/screenshot.png\",\"tenweb_product\":0,\"author\":\"Automattic\",\"repo_version\":\"3.1.4\",\"parent_theme_name\":\"\",\"theme_errors\":[]},{\"product_id\":0,\"slug\":\"sicily\",\"title\":\"Sicily\",\"description\":\"A vineyard and winery WordPress theme inspired by the wines of Sicily and the colors of Sicilian buildings. The Sicily theme is a modern block-based theme where you can own unique looking vineyard website using WordPress Blocks Editor. The Sicily theme is built in accordance with Full Site Editing (FSE) features introduced since WordPress 5.9, which means that every aspect such; as colors, typography, and layout of every page on your website is customizable to suit your needs. The Sicily theme includes block patterns, opening the door to a wide array of professionally designed layouts in just a few clicks. Whether you\\u2019re building a vineyard or wine-related website, or a different kind of website, Sicily will help you create a site that is uniquely yours.\",\"version\":\"1.0.4\",\"installed\":1,\"active\":0,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"http:\\/\\/localhost\\/balaykobo2\\/wp-content\\/themes\\/sicily\\/screenshot.png\",\"tenweb_product\":0,\"author\":\"Remon Lumapas\",\"repo_version\":\"1.0.4\",\"parent_theme_name\":\"\",\"theme_errors\":[]},{\"product_id\":0,\"slug\":\"twentytwentyone\",\"title\":\"Twenty Twenty-One\",\"description\":\"Twenty Twenty-One is a blank canvas for your ideas and it makes the block editor your best brush. With new block patterns, which allow you to create a beautiful layout in a matter of seconds, this theme\\u2019s soft colors and eye-catching \\u2014 yet timeless \\u2014 design will let your work shine. Take it for a spin! See how Twenty Twenty-One elevates your portfolio, business website, or personal blog.\",\"version\":\"1.7\",\"installed\":1,\"active\":0,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"http:\\/\\/localhost\\/balaykobo2\\/wp-content\\/themes\\/twentytwentyone\\/screenshot.png\",\"tenweb_product\":0,\"author\":\"the WordPress team\",\"repo_version\":\"1.7\",\"parent_theme_name\":\"\",\"theme_errors\":[]},{\"product_id\":0,\"slug\":\"twentytwentythree\",\"title\":\"Twenty Twenty-Three\",\"description\":\"Twenty Twenty-Three is designed to take advantage of the new design tools introduced in WordPress 6.1. With a clean, blank base as a starting point, this default theme includes ten diverse style variations created by members of the WordPress community. Whether you want to build a complex or incredibly simple website, you can do it quickly and intuitively through the bundled styles or dive into creation and full customization yourself.\",\"version\":\"1.0\",\"installed\":1,\"active\":0,\"network_active\":0,\"is_paid\":0,\"screenshot\":\"http:\\/\\/localhost\\/balaykobo2\\/wp-content\\/themes\\/twentytwentythree\\/screenshot.png\",\"tenweb_product\":0,\"author\":\"the WordPress team\",\"repo_version\":\"1.0\",\"parent_theme_name\":\"\",\"theme_errors\":[]},{\"product_id\":0,\"slug\":\"twentytwentytwo\",\"title\":\"Twenty Twenty-Two\",\"description\":\"Built on a solidly designed foundation, Twenty Twenty-Two embraces the idea that everyone deserves a truly unique website. The theme\\u2019s subtle styles are inspired by the diversity and versatility of birds: its typography is lightweight yet strong, its color palette is drawn from nature, and its layout elements sit gently on the page. The true richness of Twenty Twenty-Two lies in its opportunity for customization. The theme is built to take advantage of the Site Editor features introduced in WordPress 5.9, which means that colors, typography, and the layout of every single page on your site can be customized to suit your vision. It also includes dozens of block patterns, opening the door to a wide range of professionally designed layouts in just a few clicks. Whether you\\u2019re building a single-page website, a blog, a business website, or a portfolio, Twenty T